import Empty from "./Empty";
import Cactus from "./Cactus";
import React from "react";
import Ptero from "./Ptero";

function Cell() {
    if(Math.random() <= 0.5){
        return (<Empty></Empty>)
    }
    else if (Math.random() <= 0.5){
        return (<Cactus></Cactus>)
    }else{
        return (<Ptero></Ptero>)
    }
}
export default Cell
